about:
Meditation Teacher. Mindful PR Consultant and Stateshifting Mindset Coach.

Jacklyn is the conscious creator of Replenish to Rise and Soothe School.

It is her intent to:

Support you on your stillness and meditation journey;
Gently remind you of the power of rest in order to rise; 
Hold space and help you to do this work of replenishment, to soothe your nervous system, and to create with consciousness and clarity, as you rise to your most authentic version of you....read more
